import React, { useEffect } from "react";

function Events() {
  useEffect(() => {
    // ✅ Ladda Facebook SDK om den inte redan finns
    if (!window.FB) {
      window.fbAsyncInit = function () {
        window.FB.init({
          xfbml: true,
          version: "v19.0",
        });
      };

      const script = document.createElement("script");
      script.src = "https://connect.facebook.net/sv_SE/sdk.js";
      script.async = true;
      script.defer = true;
      script.crossOrigin = "anonymous";
      document.body.appendChild(script);
    } else {
      // Om SDK redan laddats (t.ex. via Home.js)
      window.FB.XFBML.parse();
    }
  }, []);

  return (
    <div className="card">
      <h1>Evenemang</h1>
      <p>
        Här kan du se kommande evenemang från vår officiella Facebook-sida.
      </p>

      {/* ✅ Facebook Page plugin med flik "events" */}
      <div
        className="fb-page"
        data-href="https://www.facebook.com/KumlaSportfiske/events/"
        data-tabs="events"
        data-width="500"
        data-height=""
        data-small-header="false"
        data-adapt-container-width="true"
        data-hide-cover="false"
        data-show-facepile="true"
      >
        <blockquote
          cite="https://www.facebook.com/YOUR_PAGE_URL"
          className="fb-xfbml-parse-ignore"
        >
          <a href="https://www.facebook.com/YOUR_PAGE_URL">
            Besök vår Facebook-sida
          </a>
        </blockquote>
      </div>
    </div>
  );
}

export default Events;
